
var mybulb = document.createElement("canvas");

mybulb.width = 256;
mybulb.height = 256;

var myImg = document.createElement("img");
myImg.onload = function() {
    c = mybulb.getContext("2d");
    c.drawImage(myImg, 0, 0, 256, 256)
}

